import Header from "./components/Header";
import { Route, Routes } from "react-router-dom";
import Blogs from "./pages/Blogs";

function App() {
  return (
    <Routes>
      <Header />
      <Route path="/" element={<Blogs />} />
    </Routes>
  );
}

export default App;
